                            a = await page.ScreenshotStreamAsync(new ScreenshotOptions()
                            {
                                Clip = new PuppeteerSharp.Media.Clip()
                                {
                                    Width = decimal.Parse(width),
                                    Height = decimal.Parse(height),
                                },
